import React from 'react'

class JobCard extends React.Component{
    render(){
        const {job}=this.props;
        console.log(job);
        return(
            <div className="job-card">
                <img src = {job.company_logo} style={{width:10,height:10}}></img>
            </div>
        )
    }
}


export default JobCard;
